'use strict';
let ASaltGenerator = require('./ASaltGenerator.js');
let buffer = require('@gehtsoft/LuaxStdlib-node').buffer;
//@@DocBrief("Uses for salt password data")
class PasswordSaltGenerator extends ASaltGenerator {
    decryptSalt(salt) {
        let result;
        result = buffer.fromBase64(salt);
        return result;
    }
}
module.exports = PasswordSaltGenerator
